import React from "react";
import { TextFolding } from "../TextFolding";
import { EventCountdown } from "../EventCountdown";
import TextEllipsis from "../TextEllipsis";

function App() {
  return (
    <div className="App">
      <TextFolding
        text="卡高消费卡背影删掉疯狂国际化设计的咖啡杯个双方都赶不上看对方还不够舒适的方式地方就会感慨阿妈打卡高消费卡背影够舒适的方方就会感慨阿妈打卡高消费卡背影删掉疯狂国际化设计的咖啡杯个双方都赶不上看对方还不够舒适的方式地方就会感慨阿妈打卡高消费卡背"
        maxRow={4}
      />
      <div
        style={{
          width: 400,
        }}
      >
        <TextEllipsis content="高消费卡背影删掉疯狂国际化设计的咖啡杯个双方都赶不上看对方还不够舒适的方式地方就会感慨阿妈打卡高消费卡背影够舒适的方方就会感慨阿妈打卡高消费卡背影删掉疯狂国际化设计的咖啡杯个双方都赶不上看对方还不够舒适的方式地方就会感慨阿妈打卡高消费卡背" />
      </div>
      <EventCountdown timer={9} />
    </div>
  );
}

export default App;
